import {
    createAction
}
from "../functions/createAction";

const onAddChar = createAction({
    name: "ON_ADD_CHAR",
    payload: [
        "char"
    ]
});

const onAddMath = createAction({
    name: "ON_ADD_MATH",
    payload: [
        "value"
    ]
});

const onAddSubtractMath = createAction({
    name: "ON_ADD_MATH",
    payload: [
        "value"
    ]
});

const onMultipleMath = createAction({
    name: "ON_ADD_MATH",
    payload: [
        "value"
    ]
});

const onDivideMath = createAction({
    name: "ON_ADD_MATH",
    payload: [
        "value"
    ]
});

export {
    onAddChar,
    onAddMath,
    onAddSubtractMath,
    onMultipleMath,
    onDivideMath
}
